// 542. 01 Matrix

console.clear()

function updateMatrix(mat: number[][]): number[][] {
  const rowLength = mat.length
  const colLength = mat[0].length

  const bfs = (row: number, col: number) => {
    const queue: { row: number, col: number, distance: number }[] = [{
      row,
      col,
      distance: 0
    }]
    const history = new Set()

    let possibleMin = Infinity

    while (queue.length) {
      const { row, col, distance } = queue.shift()
      const hash = `[${row},${col}]`

      if (
        history.has(hash)
        || row < 0
        || row > rowLength - 1
        || col < 0
        || col > colLength - 1
      ) {
        continue
      }

      history.add(hash)

      if (mat[row][col] > 1) {
        possibleMin = Math.min(possibleMin, mat[row][col])
      }

      if (distance >= possibleMin) {
        // console.log('return possibleMin, ', row, col, possibleMin)
        return possibleMin
      }

      if (!mat[row][col]) {
        // console.log('return distance, ', row, col, distance)
        return distance
      }

      queue.push({ row: row + 1, col, distance: distance + 1 })
      queue.push({ row: row - 1, col, distance: distance + 1 })
      queue.push({ row, col: col + 1, distance: distance + 1 })
      queue.push({ row, col: col - 1, distance: distance + 1 })
    }
  }

  for (let row = 0; row < mat.length; row++) {
    for (let col = 0; col < mat[0].length; col++) {
      if (!mat[row][col]) {
        continue
      }

      mat[row][col] = bfs(row, col)
    }
  }

  return mat
}

